import React, { useState, useEffect } from "react";

const LogAnalyzer = () => {
    const [unauthorizedLogs, setUnauthorizedLogs] = useState([]);
    const [sqlInjectionLogs, setSqlInjectionLogs] = useState([]);
    const [error, setError] = useState("");

    // Fetch Unauthorized Access Logs
    useEffect(() => {
        fetch("http://localhost:5000/api/logs/unauthorized-access")
            .then((res) => res.json())
            .then((data) => setUnauthorizedLogs(data))
            .catch((err) => setError("Failed to fetch unauthorized access logs"));
    }, []);

    // Fetch SQL Injection Logs
    useEffect(() => {
        fetch("http://localhost:5000/api/logs/sql-injection")  // ✅ Adjust API endpoint accordingly
            .then((res) => res.json())
            .then((data) => setSqlInjectionLogs(data))
            .catch((err) => setError("Failed to fetch SQL injection logs"));
    }, []);

    const addUnauthorizedLog = async () => {
        const logData = {
            source_ip: "192.168.1.100",
            destination_ip: "10.0.0.1",
            access_type: "Unauthorized",
            user_agent: "Mozilla/5.0",
            http_status_code_response: 403
        };

        try {
            const response = await fetch("http://localhost:5000/api/logs/unauthorized-access", {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify(logData)
            });

            const result = await response.json();
            if (response.ok) {
                setUnauthorizedLogs([...unauthorizedLogs, logData]);
            } else {
                setError(result.error);
            }
        } catch (error) {
            setError("Failed to add unauthorized access log");
        }
    };

    return (
        <div>
            <h2>Unauthorized Access Logs</h2>
            {error && <p style={{ color: "red" }}>{error}</p>}
            <button onClick={addUnauthorizedLog}>Add Sample Unauthorized Log</button>
            <table border="1">
                <thead>
                    <tr>
                        <th>Source IP</th>
                        <th>Destination IP</th>
                        <th>Access Type</th>
                        <th>User Agent</th>
                        <th>HTTP Status</th>
                    </tr>
                </thead>
                <tbody>
                    {unauthorizedLogs.map((log, index) => (
                        <tr key={index}>
                            <td>{log.source_ip}</td>
                            <td>{log.destination_ip}</td>
                            <td>{log.access_type}</td>
                            <td>{log.user_agent}</td>
                            <td>{log.http_status_code_response}</td>
                        </tr>
                    ))}
                </tbody>
            </table>

            {/* ✅ SQL Injection Logs Table */}
            <h2>SQL Injection Logs</h2>
            <table border="1">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>IP Address</th>
                        <th>Query</th>
                        <th>Timestamp</th>
                        <th>Status</th>
                    </tr>
                </thead>
                <tbody>
                    {sqlInjectionLogs.map((log, index) => (
                        <tr key={index}>
                            <td>{log.id}</td>
                            <td>{log.ip}</td>
                            <td style={{ color: "red", fontFamily: "monospace" }}>{log.query}</td>
                            <td>{new Date(log.timestamp).toLocaleString()}</td>
                            <td style={{ backgroundColor: log.status === "Blocked" ? "red" : "green", color: "white" }}>
                                {log.status}
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default LogAnalyzer;
